        serviceRequestDocumentEntity.setDocumentId(documentId);
        serviceRequestDocumentEntity.setCreatedOn(new Date());
        serviceRequestDocumentEntity.setCreatedBy("SCRIPT");
        serviceRequestDocumentEntity.setEntityId(assetId);
        serviceRequestDocumentEntity.setEntityName("asset");
        serviceRequestDocumentEntity.setStatus("A");
        serviceRequestDocumentEntities.add(serviceRequestDocumentEntity);
        serviceRequestDocumentEntity = new ServiceRequestEntityDocumentEntity();
        asset = asset.substring(asset.indexOf("ImageStorageReference"));
        asset = asset.substring(asset.indexOf("documentId"));
        documentId = asset.substring(asset.indexOf("=") + 1, asset.indexOf(","));
        serviceRequestDocumentEntity.setDocumentId(documentId);
